import styled from "styled-components";

export const AddUserContainer = styled.div`
    width: 100%;
    height: 108px;
    border-bottom: solid 1px #FF000050;

    padding: 20px 20px;
    display: flex;
    justify-content: space-between;

    input{
        height: 50px;
        width: 150px;
        border-radius: 10px;

        padding: 10px 10px;
        font-size: 16px;
        
    }

    form{
        display: flex;
        justify-content: space-between;
        align-items: center;
    }

    

`

export const ButtonContainer = styled.button`
    background: pink;
    width: 20px;
    height: 100%;
`
